import GreetingImage from '../images/greetingCardImg.jpg';

function CreateCard() {
    return (
        <div id="CreateCard">
            <div className="img-wrap">
				<img src={GreetingImage} alt="" />
			</div>
        </div>
    );
}

export default CreateCard;
